import React from "react";
import TeamsContainer from "./components/TeamsContainer";
import Title from "./components/Title";
import Navbar from "./components/Navbar";
const App = () => (
  <TeamsContainer>
    <Navbar>Game</Navbar>
    <Title>Clicky Game</Title>
  </TeamsContainer>
);
export default App;
